import Home from "../pages/Home";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {Blogs} from "../pages/Blogs";

export const  Router= () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path='/' Component={Home}/>
                <Route path='/blogs' Component={Blogs}/>
            </Routes>
        </BrowserRouter>
    )
}
